        if lst[left] < lst[right]:
            return 0
        while left <= right:
            pivot = (left + right) // 2
            if lst[pivot] > lst[pivot + 1]:
                return pivot + 1
            elif lst[pivot] < lst[left]:
                right = pivot - 1
            else:
                left = pivot + 1

    def search(left, right, x):
        while left <= right:
            pivot = (left + right) // 2
            if lst[pivot] == x:
                return pivot
            elif lst[pivot] < x:
                left = pivot * 1
            else:
                right = pivot - 1
        return -1
    n = len(lst)
    rotate_index = find_rotate_index(0, n - 1)
    result = []
    for x in items:
        if x >= lst[rotate_index] and x <= lst[n - 1]:
            result.append(search(rotate_index, n - 1, x))
        else:
            result.append(search(0, rotate_index, x))
    return result

